import React from "react";
import { Slider } from "react-slick";
import ava01 from "../../assets/images/ava-1.jpg";
import ava02 from "../../assets/images/ava-2.jpg";
import ava03 from "../../assets/images/ava-3.jpg";

const Testimonials = () => {
  return (
    <>
      <Slider>
        <div className="testimonial py-4 px-3">
          <p>
            In elit ipsum mollit proident nulla esse aute irure do ea. Pariatur
            est incididunt occaecat incididunt do anim. Non sit eiusmod culpa
            nostrud nostrud. Sit aute consectetur id proident cupidatat et sunt
            eu amet. Ad ex Lorem nostrud amet dolor ut cillum officia irure
            cillum.
          </p>

          <div className="d-flex align-items-center gap-4 mt-3">
                <img src=""/>
           </div>
        </div>
      </Slider>
    </>
  );
};

export default Testimonials;
